import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import 'react-phone-input-2/lib/style.css';
import HomePage from './HomePage';
import LoginPage from './Login';
import SelfEmployee from './SelfEmployee';  // Capitalized and fixed spelling
import Salaried from './Salaried';
import Personaldetails from './Personaldetails';
import Coapplicant from './coapplicant';
import IncomeDetails from './Incomedetails';
import Akasainstitute from './akasainstitute';
import AdminPanel from './AdminPanel';
import Edit from './Edit'; // Import the Edit component
import ViewApplication from './ViewApplication';
import AdminLogin from './AdminLogin';
function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<HomePage />} /> 
        <Route path="/login" element={<LoginPage />} /> 
        <Route path="/SelfEmployee" element={<SelfEmployee />} /> {/* Capital S and E */}
        <Route path="/Salaried" element={<Salaried />} />
        <Route path="/Personaldetails" element={<Personaldetails />} />
        <Route path="/coapplicant" element={<Coapplicant />} />
        <Route path="/Incomedetails" element={<IncomeDetails />} />
        <Route path="/akasainstitute" element={<Akasainstitute />} />
        <Route path="/AdminPanel" element={<AdminPanel />} />
        <Route path="/edit/:id" element={<Edit />} /> Add the Edit route
        <Route path="/ViewApplication" element={<ViewApplication />} />
        <Route path='/AdminLogin' element={<AdminLogin />} />



      </Routes>
    </Router>
  );
}

export default App;
